const e=JSON.parse('{"key":"v-4cc69158","path":"/java/010501/","title":"物件導向程式設計","lang":"zh-TW","frontmatter":{"title":"物件導向程式設計","date":"2021-02-17T17:14:09.000Z","permalink":"/java/010501/","category":["Java","Java基礎","物件導向相關"],"tag":["程式學習"],"order":1,"description":"物件導向簡介 什麼是物件導向? 物件導向是一種程式開發的抽象方針，主要的目的是為了提高軟體的重用性、擴充性。 不同於傳統的程式設計將設計程式看作一系列函式的概念，物件導向將程式的每一個部分視為一個小型的程式(機器)，使得程式問題得以容易被拆分、解析並處理。 物件導向的抽象概念 在物件導向的設計中，會將事物實例的抽象特點找出並定義；而抽象指的即對應現實事物的非具名目標，例如：汽車、飛機、狗 等，這個行為稱為 類比。對於依據類比後的抽象概念定義出的具名事物則為 物件。","head":[["meta",{"property":"og:url","content":"https://www.ed-lin.com/java/010501/"}],["meta",{"property":"og:site_name","content":"Ed Log 工程人日誌"}],["meta",{"property":"og:title","content":"物件導向程式設計"}],["meta",{"property":"og:description","content":"物件導向簡介 什麼是物件導向? 物件導向是一種程式開發的抽象方針，主要的目的是為了提高軟體的重用性、擴充性。 不同於傳統的程式設計將設計程式看作一系列函式的概念，物件導向將程式的每一個部分視為一個小型的程式(機器)，使得程式問題得以容易被拆分、解析並處理。 物件導向的抽象概念 在物件導向的設計中，會將事物實例的抽象特點找出並定義；而抽象指的即對應現實事物的非具名目標，例如：汽車、飛機、狗 等，這個行為稱為 類比。對於依據類比後的抽象概念定義出的具名事物則為 物件。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-TW"}],["meta",{"property":"og:updated_time","content":"2023-03-02T13:04:26.000Z"}],["meta",{"property":"article:tag","content":"程式學習"}],["meta",{"property":"article:published_time","content":"2021-02-17T17:14:09.000Z"}],["meta",{"property":"article:modified_time","content":"2023-03-02T13:04:26.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"物件導向程式設計\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2021-02-17T17:14:09.000Z\\",\\"dateModified\\":\\"2023-03-02T13:04:26.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"物件導向簡介","slug":"物件導向簡介","link":"#物件導向簡介","children":[{"level":3,"title":"什麼是物件導向?","slug":"什麼是物件導向","link":"#什麼是物件導向","children":[]},{"level":3,"title":"物件導向的抽象概念","slug":"物件導向的抽象概念","link":"#物件導向的抽象概念","children":[]},{"level":3,"title":"物件導向的特徵","slug":"物件導向的特徵","link":"#物件導向的特徵","children":[]}]},{"level":2,"title":"物件導向的三大特性","slug":"物件導向的三大特性","link":"#物件導向的三大特性","children":[{"level":3,"title":"封裝","slug":"封裝","link":"#封裝","children":[]},{"level":3,"title":"繼承","slug":"繼承","link":"#繼承","children":[]},{"level":3,"title":"多型","slug":"多型","link":"#多型","children":[]}]}],"git":{"createdTime":1677762266000,"updatedTime":1677762266000,"contributors":[{"name":"LSYu7152","email":"k1207152@gmail.com","commits":1}]},"readingTime":{"minutes":6.37,"words":1912},"filePathRelative":"java/01.Java基礎/05.物件導向相關/01.物件導向程式設計.md","localizedDate":"2021年2月18日","excerpt":"<h2> 物件導向簡介</h2>\\n<h3> 什麼是物件導向?</h3>\\n<p>物件導向是一種程式開發的抽象方針，主要的目的是為了提高軟體的<strong>重用性</strong>、<strong>擴充性</strong>。</p>\\n<p>不同於傳統的程式設計將設計程式看作一系列函式的概念，物件導向將程式的每一個部分視為一個小型的程式(機器)，使得程式問題得以容易被拆分、解析並處理。</p>\\n<h3> 物件導向的抽象概念</h3>\\n<p>在物件導向的設計中，會將事物實例的抽象特點找出並定義；而抽象指的即對應現實事物的非具名目標，例如：汽車、飛機、狗 等，這個行為稱為 <strong>類比</strong>。對於依據類比後的抽象概念定義出的具名事物則為 <strong>物件</strong>。</p>","autoDesc":true}');export{e as data};
